  Component
} from "react";
import Navigation from "./Component/Navigation/Navigation"
import Logo from "./Component/Logo/Logo"
import ImageLinkForm from "./Component/"
import "./App.css";


class App extends Component {
  render() {
    return ( 
      <div className = "App" >
      <Navigation/> 
      <Logo /> 
      <ImageLinkForm/> {/*
          <FaceRecognition/>  */}
      </div>
    );
  }
}

export default App;
